typedef  struct _wide_unicode_font12x12 font12x12;

static inline unsigned gb2312_font_offset(unsigned g)
{
	unsigned l = g & 0xff;
	unsigned h = (g>>8) & 0xff;

	return (l - 0xa1) * (0xf8 - 0xb0) + (h - 0xb0);
}

static const unsigned char* find_gb2312_font(wchar_t unicode)
{
	unsigned g = unicode_to_gbk(unicode);

	if( !is_gb2312(g) ) return NULL;

	return wide_unicode_font12x12[ gb2312_font_offset(g) ].data;
}


int draw_font_wide(int bx, int by, int utf, class sFramebuffer *pfb)
{
	int x, y, val;
	unsigned char *p = (unsigned char *)find_gb2312_font(utf);

	if( !p ) return 12;

	for(y=0; y<12; y++)
	{
		for(x=0; x<12; x++)
		{
			val = (p[x>>3]>>((~x&7))) & 1;
			pfb->setXy(x+bx, y+by, val);
#if CMD_FONT
			if(val)
			{
				printf("文");
			}
			else
			{
				printf("  ");
			}
#endif			
		}
#if CMD_FONT		
		printf("\n");
#endif            
		p+=2;
	}
	
	return 12;
}


int draw_font_tiny(int bx, int by, wchar_t unicode, class sFramebuffer *pfb)
{
      int x, y, val;
      const unsigned char *p;
      
      if( unicode < 0x0021 || unicode > 0x007e ) return 6;
      
      p = thin_unicode_font6x12[ unicode - 0x0021 ].data;

      for(y=0; y < 12; y++)
      {
            for(x=0; x < 6; x++)
            {
                  val = (p[y] >> (~x&7)) & 1;
                  pfb->setXy(x+bx, y+by, val);
#if CMD_FONT
                  if(val)
                  {
                        printf("**");
                  }
                  else
                  {
                        printf("  ");
                  }
#endif
            }
#if CMD_FONT
            printf("\n");
#endif
      }

      return 6;
}


int draw_font(int bx, int by, wchar_t unicode, class sFramebuffer *pfb)
{
      if( unicode < 0xff ) return draw_font_tiny(bx, by, unicode, pfb);
      
      return draw_font_wide(bx, by, unicode, pfb);
}

bool font_enable_draw(wchar_t unicode)
{
      if( unicode > 0x00ff ) return is_gb2312( unicode_to_gbk(unicode) );
      
      return unicode >= 0x0021 && unicode <= 0x007e;     
}

int get_font_height()
{
      return 12;
}

int get_font_weight(wchar_t unicode)
{
      if( unicode < 0x007f ) return 6;

      return 12;
}

int get_text_weight(wchar_t *str)
{
      int weight = 0;

      while(*str)
      {
            if( *str < 0x00ff )
            {
                  weight += 6;
            }
            else
            {
                  weight += 12;
            }
            
            str++;
      }

      return weight;
}

int get_text_weight(wchar_t *str, int len)
{
      int weight = 0;
      
      for(int i=0; i<len; i++)
      {
            if( str[i] < 0x007f )
            {
                  weight += 6;
            }
            else
            {
                  weight += 12;
            }
      }

      return weight;
}

